import React, { Component } from 'react';
import Footer from '../component/footer';
import Header from '../component/header';

class Ligin extends Component{
    render() {
      return  <div>
      <Header></Header>
        <h3>我们是星际移民公司</h3>
      <Footer></Footer>
      </div>
    }
}

export default Ligin;
